INSERT INTO `bots` VALUES (2,'765374132799930380','MultiBan','https://cdn.discordapp.com/avatars/765374132799930380/51499a7184bb4b10904b9fa1c592ed93.png?size=512','null','282762192544333827','FAXES#8655','Tue Dec 01 2020 02:41:27 GMT+0100 (Central European Standard Time)','!',1,'Sync your guilds bans with another guild. If you ban a user from one guild they will be banned from the other synced guilds.','https://discord.com/oauth2/authorize?client_id=765374132799930380&scope=bot&permissions=11396','https://botguys.net/discord','https://botguys.net/multiban','null','null','discord.js','<h2>About</h2>\r\n<p class=\"botDescP\">Sync your guilds bans with another guild. If you ban a user from one guild they will be banned from the other synced guilds.</p>\r\n<hr class=\"botDescHR\" />\r\n<h2>Commands</h2>\r\n<ul class=\"botDescul\">\r\n<li class=\"botDescli\"><code>!help</code> Displays the help command.</li>\r\n<li class=\"botDescli\"><code>!add &lt;other guild ID&gt;</code> Add another guild and sync their ban lists</li>\r\n<li class=\"botDescli\"><code>!remove &lt;other guild ID&gt;</code> Remove the guild from your synced bans</li>\r\n</ul>\r\n',0,0,0,0,1,0,0,0,14,'4',1,1,0,0,'gnasdJjWbJdno3iupErG',56,'1644944964299','multiban',1),(3,'773099317710815252','Sticke','https://cdn.discordapp.com/avatars/773099317710815252/fa3f28ec83a9129d2b87562d655047aa.png?size=512','null','282762192544333827','FAXES#8655','Tue Dec 01 2020 03:03:55 GMT+0100 (Central European Standard Time)','!',1,'Sticke allows users to set a sticky message that persistently stays at the bottom of a channels chat.','https://botguys.net/sticke/i','https://botguys.net/discord','https://botguys.net/sticke','null','null','discord.js','<h2>About</h2>\n<p class=\"botDescP\">Sticke allows users to set a sticky message that persistently stays at the bottom of a channels chat.</p>\n<hr class=\"botDescHR\" />\n<h2>Commands</h2>\n<ul class=\"botDescul\">\n<li class=\"botDescli\"><code>!stickycreate &lt;message&gt;</code></li>\n<li class=\"botDescli\"><code>!stickydelete</code></li>\n</ul>\n',0,0,0,0,1,0,0,0,2,'5',1,0,0,0,'zZJv-9eX7rABmVM4DT84',22,'1644945564239','sticke',1),(4,'770480621263912970','GoogBot','https://cdn.discordapp.com/avatars/770480621263912970/aac909d9d5dbdc0f3955631d053d9457.png?size=512','null','329858985589080064','Beefer#3014','Tue Dec 01 2020 03:04:32 GMT+0100 (Central European Standard Time)','!',1,'Just an simple meme for people to use! Go google it haha!','https://botguys.net/googbot/i','https://botguys.net/discord','https://botguys.net/googbot','null','null','discord.js','<h2>About</h2>\n<p class=\"botDescP\">It\'s just a simple one command bot, That displays greatness.</p>\n<hr class=\"botDescHR\" />\n<h2>Commands</h2>\n<ul class=\"botDescul\">\n<li class=\"botDescli\"><code>!googit</code></li>\n</ul>\n',1,0,0,0,0,0,0,0,3,'3',0,0,0,0,'dzBal5q16GAK8eB7HwJQ',15,'1644945563769','googbot',0),(5,'743539244320030810','Reborn Bot','https://cdn.discordapp.com/avatars/743539244320030810/b342e0fb7a4a5d74d9388fa4701a96c7.png?size=512','758707959433134130','287252547629219840','Smirf123#5911','Tue Dec 01 2020 03:11:47 GMT+0100 (Central European Standard Time)','r!',0,'Reborn Bot, built with your server in mind, packed full of features and updated with user requests.','https://discord.com/oauth2/authorize?client_id=743539244320030810&permissions=8&scope=bot%20applications.commands.update%20applications.commands','https://discord.gg/h3NhAh9','https://rebornbot.statuspage.io/','null','https://www.patreon.com/dorjrp','discord.py','<link rel=\"stylesheet\" href=\"https://www.w3schools.com/w3css/4/w3.css\">\r\n<link rel=\"stylesheet\" href=\"https://www.w3schools.com/lib/w3-theme-blue-grey.css\">\r\n<style>\r\n.mbdy {background-color: #2C2F33    }\r\np {color: white}\r\n</style>\r\n<div class= \"mbdy\">\r\n    <div class=\"w3-bar w3-theme\">\r\n        <h1 align=\"center\">Reborn Bot: The Discord Bot</h1>\r\n        <p align=\"center\">Simple but Robust</p>\r\n        <a href=\"https://disbot.top/bot/743539244320030810\" class=\"w3-bar-item w3-button w3-right\"><img class=\"w3-hide-small w3-circle\" src=\"https://cdn.discordapp.com/attachments/636279926240313398/813173351354466324/Bot_transp.png\" style=\"height:128px;\"></a>\r\n      </div>\r\n<p>The Reborn Bot by Smirf123 is a bot that is on the run for the top. The bot originally was a giveaway management bot for our server but grew into more that that. We plan for even more features that will make the bot better for Roleplay, for star wars enthusiests, support server, lego enthusiests, and just any server out there. Current Features:</p>\r\n<p>r!botinvite</p>\r\n<p>r!chuck</p>\r\n<p>r!meme</p>\r\n<p>r!yoda</p>\r\n<p>r!ban</p>\r\n<p>r!kick</p>\r\n<p>r!mute</p>\r\n<p>r!warn</p>\r\n<p>r!catfact</p>\r\n<p>r!christmas</p>\r\n<p>r!catfact</p>\r\n<p>r!editedmessagelog</p>\r\n<p>r!serverlog</p>\r\n<p>r!infractions</p>\r\n<p>r!insult</p>\r\n<p>r!botinvite</p>\r\n<p>r!server</p>\r\n<p>r!supporter</p>\r\n<p>r!say</p>\r\n<p>r!securityhelp</p>\r\n<p>** BETA FEATURES **</p>\r\n<p>r!join</p>\r\n<p>r!leave</p>\r\n<p>r!play</p>\r\n<p>and giveaway management</p>\r\n<p>We are always looking for new features and suggestions, so join our Discord server or dm Smirf123#5911</p>\r\n</div>',1,0,1,0,1,0,0,0,30,'5',1,1,0,0,'lfSMn-nOXJmRLv_sk26X',93,'1619206751732','rebornbot',0),(6,'779360451682631740','Secure Bot','https://cdn.discordapp.com/avatars/779360451682631740/c6e2b828db0877cb52f399b890a71a12.png?size=512','null','287252547629219840','Smirf123#5911','Tue Dec 01 2020 03:13:56 GMT+0100 (Central European Standard Time)','s!',0,'Secure Bot is a bot built for the server owner looking for security in their server.','https://discord.com/api/oauth2/authorize?client_id=779360451682631740&permissions=392278&scope=bot','https://discord.gg/r3H2fDMfcD','null','null','null','discord.py','<p>Secure Bot</p>\r\n<p>Built by Smirf123#5911</p>\r\n<p>A bot built for the owner looking for security in thier server.</p>\r\n<p>Commands s!botinfo, Gives basic info about the bot like user count and developer info<br />\r\ns!user (user id), Checks against our Bad User Database<br />\r\ns!report, (DM COMMAND) Begins the reporting process for the bot, caution all commands have a 45 second timeout.</p>\r\n<p>Functions:<br />\r\nUser Reporting<br />\r\nUser Check against Database of known bad users</p>\r\n<p>Future Planned Features<br />\r\nAutomatic Banning of bad users (Will be automatically opted out, owner must opt in)<br />\r\nAnti-Raid/Automatic Reporting of raids to bad user database</p>\r\n<p>Anti-Spam/Reporting of Bad User</p>\r\n<p>WE DO NOT COLLECT ANY INFORMATION OTHER THAN USER IDs and EVIDENCE YOU GIVE THE BOT</p>\r\n',0,0,0,0,1,0,0,0,9,'4',1,1,0,0,'_INK6RY_BW2WlaKMwdAM',56,'1631565192242','secure-bot',0),(7,'764645053338746880','UselessBot','https://cdn.discordapp.com/avatars/764645053338746880/76f4d4211ee45da7f80480631cbed978.png?size=512','null','282762192544333827','FAXES#8655','Tue Dec 01 2020 03:59:20 GMT+0100 (Central European Standard Time)','!',1,'Need a fun or interesting fact? Or even a random website that does something cool or not normal? UselessBot will be right for you. Name from TheUselessWeb moved over to Discord to help make your experience more odd.','https://botguys.net/useless/i','https://botguys.net/discord','https://botguys.net/useless','null','null','discord.js','<h2>About</h2>\n<p class=\"botDescP\">Need a fun or interesting fact? Or even a random website that does something cool or not normal? UselessBot will be right for you. Name from TheUselessWeb moved over to Discord to help make your experience more odd.</p>\n<hr class=\"botDescHR\" />\n<h2>Commands:</h2>\n<ul class=\"botDescul\">\n<li class=\"botDescli\"><code>!useless fact</code></li>\n<li class=\"botDescli\"><code>!useless f</code></li>\n<li class=\"botDescli\"><code>!useless website</code></li>\n<li class=\"botDescli\"><code>!useless w</code></li>\n</ul>\n',1,0,0,0,0,0,0,1,2,'4',0,0,0,0,'pkGz3VOcMUIwK-71DgZ7',19,'1644945564338','useless',0),(8,'770424650370121770','EmbedBuilder','https://cdn.discordapp.com/avatars/770424650370121770/19a658d2e53c7ab662f639dd97b5593f.png?size=512','329858985589080064','282762192544333827','FAXES#8655','Tue Dec 01 2020 04:03:34 GMT+0100 (Central European Standard Time)','!',1,'Create and build your own embeds to be sent from the bot on behalf of you. This makes your announcements and messages look nice and clean.','https://botguys.net/embedbuilder/i','https://botguys.net/discord','https://botguys.net/embedbuilder','null','null','discord.js','## About\r\nCreate and build your own embeds to be sent from the bot on behalf of you. This makes your announcements and messages look nice and clean.\r\n\r\n## Commands\r\n\r\n- `!help` - View the bots commands and information.\r\n- `!say <message>` - Echo a message as the bot.\r\n- `!sayem <message>` - Echo a message as an embed.\r\n- `!sayad` - Open an advanced embed builder.\r\n',0,0,0,0,1,0,0,0,13,'4',1,0,0,0,'aD-9K8MPor-b0bw6qmr8',33,'1642252103883','embedbuilder',1),(9,'771184376541216779','Giveawot','https://cdn.discordapp.com/avatars/771184376541216779/b5d10272397a1d3f19d8a33624903aaf.png?size=512','null','282762192544333827','FAXES#8655','Tue Dec 01 2020 04:05:48 GMT+0100 (Central European Standard Time)','!',1,'Create and build your own embeds to be sent from the bot on behalf of you. This makes your announcements and messages look nice and clean.','https://botguys.net/embedbuilder/i','https://botguys.net/discord','https://botguys.net/embedbuilder','null','null','discord.js','<h2>About</h2>\n<p class=\"botDescP\">Create and build your own embeds to be sent from the bot on behalf of you. This makes your announcements and messages look nice and clean.</p>\n<hr class=\"botDescHR\" />\n<h2>Commands</h2>\n<ul class=\"botDescul\">\n<li class=\"botDescli\"><code>!gcreate</code> Creates a giveaway</li>\n<li class=\"botDescli\"><code>!gc</code> Creates a giveaway</li>\n<li class=\"botDescli\"><code>!gdelete</code> Deletes a giveaway</li>\n<li class=\"botDescli\"><code>!gd</code> Deletes a giveaway</li>\n<li class=\"botDescli\"><code>!greroll</code> Re-rolls a giveaway</li>\n<li class=\"botDescli\"><code>!grr</code> Re-rolls a giveaway</li>\n</ul>\n',0,0,0,0,1,0,0,0,13,'4',0,0,0,0,'hBOxc2DlJvLbdS8ea1jt',16,'1644945264094','giveawot',1),(10,'773515557764464681','Calculations','https://cdn.discordapp.com/avatars/773515557764464681/127e121a976986c617807b694c5c2872.png?size=512','null','282762192544333827','FAXES#8655','Tue Dec 01 2020 04:11:02 GMT+0100 (Central European Standard Time)','!',1,'Lets do some maths! Calculations bot allows you to perform equations and get some cool answers.','https://botguys.net/calculations/i','https://botguys.net/discord','https://botguys.net/calculations','null','null','discord.js','<h2>About</h2>\r\n<p class=\"botDescP\">Lets do some maths! Calculations bot allows you to perform equations and get some cool answers.</p>\r\n<hr class=\"botDescHR\" />\r\n<h2>Commands</h2>\r\n<ul class=\"botDescul\">\r\n<li class=\"botDescli\"><code>!calc &lt;equation&gt;</code></li>\r\n</ul>\r\n<p class=\"botDescP\"><strong>Calculations also reads all chat messages and checks if they\'re an equation.</strong></p>\r\n',0,0,0,0,0,0,0,0,2,'3',0,0,0,0,'4fKu6Ohf6lDQ-d8hGYIH',16,'1644945563677','calculator',1),(12,'774709419748491285','Ocean State Radio','https://cdn.discordapp.com/avatars/774709419748491285/afa0c2554caf95e93e645543736381e9.png?size=512','null','306838265174949888','Cubik#0001','Tue Dec 01 2020 05:39:44 GMT+0100 (Central European Standard Time)','r!',0,'Ocean State Live is a online radio station aimed at playing during GTA 5 Roleplay but available globally.','https://discord.com/oauth2/authorize?client_id=774709419748491285&permissions=8&scope=bot','null','null','null','null','discord.js','<p>Ocean State Live is a 24/7 Non-Stop Pop Music Bot that plays in FiveM, Online through Alexa and Google Home devices.</p>\n<p>Commands:<br />\nr!help - All bot commands, links etc.<br />\nr!join - Joins your Voice Channel<br />\nr!leave - Leaves your Voice Channel</p>\n<p>External Apps:</p>\n<p>-- ALEXA SKILL --<br />\nCanada: <a href=\"https://www.amazon.ca/dp/B08MC36MTD\">https://www.amazon.ca/dp/B08MC36MTD</a><br />\nUnited Kingdom: <a href=\"https://www.amazon.co.uk/dp/B08MC36MTD\">https://www.amazon.co.uk/dp/B08MC36MTD</a><br />\nUnited States: <a href=\"https://www.amazon.com/dp/B08MC36MTD\">https://www.amazon.com/dp/B08MC36MTD</a></p>\n<p>-- GOOGLE ASSISTANT --<br />\n<a href=\"https://assistant.google.com/services/a/uid/000000e3ae7300f4?hl=en\">https://assistant.google.com/services/a/uid/000000e3ae7300f4?hl=en</a></p>\n<p>-- ONLINE --<br />\n<a href=\"https://oceanstaterp.com/radio\">https://oceanstaterp.com/radio</a></p>\n',0,0,1,0,0,0,0,1,11,'4',0,1,0,0,'j6InOKZWxV4aOfD_3voK',NULL,NULL,NULL,0),(13,'570211940782309377','StrongerTogether Bot','https://cdn.discordapp.com/avatars/570211940782309377/3e667ce11d739a8791c34635ef290ba8.png?size=512','399718367335940117','282762192544333827','FAXES#8655','Tue Dec 01 2020 06:24:45 GMT+0100 (Central European Standard Time)','!stt',0,'The Stronger Together Discord Bot is a Discord bot designed to protect your community from the bad. All people that are banned by members on the Stronger Together Team get banned in servers you add this bot too, making it synced! this protects you and others from the un-trusted that leak, rip and distribute our assets!','https://discord.com/oauth2/authorize?client_id=570211940782309377&scope=bot&permissions=8','https://discord.gg/T47EUABrTQ','https://strongertogether.network','null','null','discord.js','## About\r\n\r\nThe Stronger Together Discord Bot is a Discord bot designed to protect your community from the bad. All people that are banned by members on the Stronger Together Team get banned in servers you add this bot too, making it synced! this protects you and others from the un-trusted that leak, rip and distribute our assets!\r\n\r\n\r\nStrongerTogether is keeping it going\r\n\r\n---\r\n\r\n## Links\r\n\r\n[STT Website](https://strongertogether.network)\r\n[All STT News](https://strongertogether.network/category/1)\r\n[STT Bot Changelog](https://strongertogether.network/category/2)\r\n[STT Discord Server](https://discord.gg/T47EUABrTQ)',0,0,0,0,1,0,0,0,88,'5',1,0,0,0,'RvfAvpSFnkx2WxCrZ0Su',243,'1638276245479','stt',1),(17,'715707378464456755','Xen Applications','https://cdn.discordapp.com/avatars/715707378464456755/947e50d7a320368388f33c8f9e8de71f.png?size=512','399718367335940117,389558396195438593','389558396195438593','IceyyM8#0816','Thu Dec 03 2020 15:02:48 GMT+0100 (Central European Standard Time)','>',0,'A simple to use, one stop system for applications.','https://top.gg/bot/715707378464456755/invite','https://discord.xendev.us','https://xendev.us','null','null','discord.js','<p>Features:</p>\r\n<ul>\r\n<li>Unlimited Applications</li>\r\n<li>Unlimited Questions</li>\r\n<li>Applications opened in private channels</li>\r\n<li>Full Application logging</li>\r\n</ul>\r\n<p>We thank you for checking us out!</p>\r\n',0,0,0,0,0,0,0,1,4,'5',0,0,0,0,'mO6l-9QUi5ciq87zzhhJC2eiu-ylrDji94x',NULL,NULL,'xen',0),(18,'752766470026559508','Xen Reactions','https://cdn.discordapp.com/avatars/752766470026559508/615dd1ab2ee4a9a59fa1a4f6cfd29eac.png?size=512','399718367335940117,389558396195438593','389558396195438593','IceyyM8#0816','Thu Dec 03 2020 15:06:07 GMT+0100 (Central European Standard Time)','r!',0,'Welcome to Xen Reactions! A simple to use reaction menu creator to automate roles in your discord.','https://discord.com/oauth2/authorize?client_id=752766470026559508&scope=bot&permissions=8','https://discord.xendev.us','https://xendev.us','null','null','discord.js','<p>Xen Reactions was created to simplify giving roles to your members! You can also use this a verification system. The menu limits are endless and there will never be a premium version everyone is allowed to use everything!</p>\n<p>Commands:<br />\ncreate -	Create a reaction role menu.<br />\nadd	- Add a reaction role to an existing menu.<br />\nremove - Remove a reaction role from a menu.<br />\ncheck - Check the reactions on a specified reaction role menu.<br />\nclearall - This will clear all the menus within your discord server.<br />\nblock - Block a member from using me in your server, or blocks me from being able to give a role.<br />\nlogs - Sets the logging channel which will log menu creations, menu deletions, menu edits, and roles taken/given.</p>\n',0,0,0,0,1,0,0,0,1,'5',0,0,0,0,'06xF4d82es_Dy0Tea63KDOgjB8VBnJLB6cs',NULL,NULL,NULL,0),(19,'737846441971679293','Shopify','https://cdn.discordapp.com/avatars/737846441971679293/596056ef8089a67a32b73fa2f4d542ee.png?size=512','389558396195438593, 399718367335940117','389558396195438593','IceyyM8#0816','Thu Dec 03 2020 15:10:13 GMT+0100 (Central European Standard Time)','s!',0,'Shopify allows you to easy power a marketplace with one bot, create products and have them processed like market discords do!','https://discord.com/oauth2/authorize?client_id=737846441971679293&scope=bot&permissions=8','https://xendev.us','https://xendev.us','null','null','discord.js','<p>Shopify was created with a simple goal, why not create a bot which can process orders for marketplace discords and make it free, so that\'s what we did</p>\n<p>Shopify features a full order system with the ability to process and recieve orders, more updates coming soon.</p>\n',0,0,0,0,0,1,0,0,1,'5',0,0,0,0,'zbTiNUYBGZRsk19S4qJYcFhK_sq34Atw9rk',NULL,NULL,NULL,0),(20,'769351346180587551','Among Us','https://cdn.discordapp.com/avatars/769351346180587551/9e838c89c2217bfdcb576261dba3bbf3.png?size=512','null','646087652814225439','lovo#5953','Thu Dec 03 2020 23:25:43 GMT+0100 (Central European Standard Time)','au!',0,'Ever wanted to control an Among Us game with a few simple games? Or just find out everything there is about it? Invite this bot to get that!','https://discord.com/api/oauth2/authorize?client_id=769351346180587551&permissions=301329488&scope=bot','https://discord.gg/5TEs9kq3HF','null','https://github.com/lIovo/Among-Us-Bot','null','discord.js','<body>\n    <center><b><u><h3 style=\"color:#7016f9;\">Basic Info!</h3></b></u>\n        <p style=\"color:#0088ff;\">‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ</p>\n        <u><h5 style=\"color:#d43f3f;\">What it Does:</h5></u>\n        <p style=\"color:white;\">If you ever wanted to control your Among Us game from a control panel or even by running some few simple commands, here is the bot that allows you to do it! You can find all initial commands by using <b>au!help</b></p>\n        <p style=\"color:#0088ff;\">‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ</p>\n        <u><h5 style=\"color:#d43f3f;\">Host Commands:</h5></u>\n        <p style=\"color:white;\"><b>au!createGame</b> - Creates all the necessary channels to have a fully functioning game <br> <b>au!clearGame</b> - Deletes all the channels that was created in the <b>createGame</b> command <br> <b>au!panel</b> - Displays a reaction based panel to mute and unmute useres <br> <b>au!dead [@user]</b> - Mark a player as dead and they will be muted in the voice chat until the game is over <br> <b>au!add [@user]</b> - Adds the mentioned user to the game <br> <b>au!remove [@user]</b> - Removes the mentioned user from the game</p>\n        <p style=\"color:#0088ff;\">‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ</p>\n        <u><h5 style=\"color:#d43f3f;\">Fun Commands:</h5></u>\n        <p style=\"color:white;\"><b>au!trivia</b> - Asks you a trivia question related to the game, and you have 10 seconds to respon <br> <b>au!meme</b> - Displays a meme from r/AmongUsMemes <br> <b>au!sus</b> - See someone\'s sus level with this</p>\n        <p style=\"color:#0088ff;\">‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ</p>\n        <u><h5 style=\"color:#d43f3f;\">Tasks Command:</h5></u>\n        <p style=\"color:white;\">Obviously this would be flood if we decided to put all of the tasks in here. All the tasks can be found using the <b>au!help tasks</b> command!</p>\n              <p style=\"color:#0088ff;\">‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ‚îÑ</p>\n        <u><h5 style=\"color:#d43f3f;\">Stats Command:</h5></u>\n        <p style=\"color:white;\"><b>au!imposter</b> - Displays your chances of becoming an imposter <br> <b>au!mira</b> - Displays the stats related to the <b>Mira HQ</b> map <br> au!polus - Displays the stats related to the <b>Polus</b> map <br> <b>au!skeld</b> - Displays the stats related to the <b>Skeld</b> map\n</body>\n</center>',1,1,0,0,0,0,0,1,4,'4',0,0,0,0,'MpIqbMb9mU8ALZCYwFKs7Ad-Tz7p66AmUCx',NULL,NULL,NULL,0),(35,'693432552307818556','Apex Moderation','https://cdn.discordapp.com/avatars/693432552307818556/1a153a00349d163d7e0e36d275870de5.png?size=512','null','428501344391921665','Apexi#8769','Tue Dec 08 2020 11:21:49 GMT+0100 (Central European Standard Time)','.',1,'Apex Moderation was created to be an ease t