mmand is used to show the weather in a city<br />\n!xmas This command will tell you how long until xmas</p>\n<p>Information<br />\n!ava This will show a photo of a user in the guild<br />\n!help this command will show you the help menu of the bot<br />\n!invite This will send the invite of the bot to users so they can use the bot as well<br />\n!ping this command will tell the Latency the bot currently has<br />\n!serverinfo shows the info of the whole server<br />\n!uptime this command will tell you how long the bot has been up for<br />\n!whois This will display a users info</p>\n<p>Moderation<br />\n!lockdownsetup Sets up roles that can Bypass chats that have been locked down.<br />\n!setmute Sets up roles that can be muted.<br />\n!setup Sets logs to selected channel Ex #General notifcations will be sent if admin permissions such as Kick or Ban<br />\n!set-topic Sets the topic of a channel<br />\n!ban this command will ban a member<br />\n!kick this command will kick a member from your discord<br />\n!lockdown This command is used to lockdown channels<br />\n!mute this command will mute a member in your guild<br />\n!purge bulk delete messages<br />\n!sayem Makes the bot send a message in an embed<br />\n!templock This command is used to lockdown channels for a period of time<br />\n!unban This command will unban a user<br />\n!unlock This command is used to unlock channels after a lockdown</p>\n<p>Auto Role &amp; Giveaway<br />\n!delete-giveaway delete a giveaway<br />\n!re-roll roll another winner<br />\n!remove-reaction remove reaction from a reactionrole message<br />\n!set-reaction set reaction to a message<br />\n!start-giveaway starts a giveaway</p>\n<p>more commands are being worked on and added</p>\n',1,1,1,0,1,0,0,0,8,'5',0,1,0,0,'PpS2olBju7OFaUj0vLZokFV8yL47wKp7WNr',19,'1609848141746','multiguild',0),(39,'787508369547984897','A Dog','https://cdn.discordapp.com/avatars/787508369547984897/80b00c703006e64ea3b2be56435abc03.png?size=512','null','2827621925