nd that can be done by doing .eb</p>\n<p>Commands: .help, .commands, .eb, .uptime, .botinfo, . new, .close, .rename</p>\n<p>This bot also has logs just do .help to see what you need to do.</p>\n',1,0,0,0,0,0,0,0,8,'5',0,0,0,0,'XaoxBA5JffMLrfaIrJBfpWFNrdiIn8PyJvX',NULL,NULL,'BtaTickets',0),(54,'784981669459001365','Syntax Checker','https://cdn.discordapp.com/avatars/784981669459001365/c172b5e6376fb0795bb43fc753d564f4.png?size=512','null','282762192544333827','FAXES#8655','Mon Dec 21 2020 10:28:26 GMT+0100 (Central European Standard Time)','N/A',0,'Check your code in your server. Help your community learn. This bot checks code sent in Discord channels and replies with a reaction if the syntax is correct.\r\n','https://discord.com/oauth2/authorize?client_id=784981669459001365&scope=bot&permissions=76864','https://faxes.zone/discord','null','null','https://paypal.me/FAXES/5','discord.js','## About\r\nCheck your code in your server. Help your community learn. This bot checks code sent in Discord channels and replies with a reaction if the syntax is correct.\r\n\r\n## Supported Languages\r\n- PHP\r\n- Ruby\r\n- Python\r\n- Perl\r\n- Lua\r\n- Bash\r\n- c\r\n- c++\r\n- js\r\n\r\n---\r\n\r\nThis bot uses the [syntax-checker-new package](https://www.npmjs.com/package/syntax-checker-new) created by [FAXES](https://faxes.zone)',0,0,0,0,0,0,0,0,8,'5',0,0,0,0,'22288qDhJdkJgQrO5TunK0jy3Ms0p2sGsbU',8,'1644944963739','syntaxchecker',1),(56,'787463078690029589','FiveM Server Tracker','https://cdn.discordapp.com/avatars/787463078690029589/021cfd4b80c9680b00c7b9af825910d4.png?size=512','null','748991325763797123','Aml#1234','Sat Dec 26 2020 02:35:44 GMT+0100 (Central European Standard Time)','st!',0,'This is a short and simple bot that uses requests to get data from fivem servers and display it to their own discord server.','https://discord.com/api/oauth2/authorize?client_id=787463078690029589&permissions=0&scope=bot','null','null','null','null','discord.py','<p>This is a short and simple bot that uses requests to get data from fivem servers and display it to their own discord server.  This bot includes the commands help, status and update, through the help command the users can get a short list of the commands they can use, through the status command, users can get a display of the data of their fivem players and the player list.</p>\n',0,0,0,0,0,0,0,0,3,'5',0,1,0,0,'lI_xpXbdN1kOlAzowJPPyvjdrK-mLE3tCLO',NULL,NULL,'FiveM Server Tracker',1),(57,'719589710741372938','Luibot','https://cdn.discordapp.com/avatars/719589710741372938/2b91846c53855dabf2761f0c14a1ef73.png?size=512','null','510963334426918912','Luitrixx#7274','Sun Dec 27 2020 02:23:44 GMT+0100 (Central European Standard Time)','lu!',0,'Luibot is a multipurpose discord bot that offers you all the features you  need to run and manage your server and much more!','https://discord.com/oauth2/authorize?client_id=719589710741372938&scope=bot&permissions=805310526','https://discord.gg/8GpUxd3','null','null','null','discord.js','<p class=\"botDescP\">Luibot is a multi purpose bot with a lot of features  users the bot hold features such as:</p>\n<h1>General Commands</h1>\n<ul class=\"botDescul\">\n<li class=\"botDescli\">„Äãhelp</li>\n<li class=\"botDescli\">„Äãinvite</li>\n<li class=\"botDescli\">„Äãpremium</li>\n<li class=\"botDescli\">„Äãsettings</li>\n</ul>\n<h1>Fun / Game Commands</h1>\n<ul class=\"botDescul\">\n<li class=\"botDescli\">„Äã8Ball</li>\n<li class=\"botDescli\">„Äãrps</li>\n</ul>\n<h1>Server Commands</h1>\n<ul class=\"botDescul\">\n<li class=\"botDescli\">„Äãemojis</li>\n<li class=\"botDescli\">„Äãroles</li>\n<li class=\"botDescli\">„Äãuserinfo</li>\n</ul>\n<h1>Voice Commands</h1>\n<ul class=\"botDescul\">\n<li class=\"botDescli\">„Äãdisconnect</li>\n<li class=\"botDescli\">„Äãjoin</li>\n<li class=\"botDescli\">„Äãloop</li>\n<li class=\"botDescli\">„Äãplay</li>\n<li class=\"botDescli\">„Äãqueue</li>\n<li class=\"botDescli\">„Äãskip</li>\n</ul>\n<h1>Moderation Commands</h1>\n<ul class=\"botDescul\">\n<li class=\"botDescli\">„Äãkick</li>\n<li class=\"botDescli\">„Äãban</li>\n<li class=\"botDescli\">„Äãclear</li>\n</ul>\n<h1>Premium Commands</h1>\n<ul class=\"botDescul\">\n<li class=\"botDescli\">„Äãset-ai</li>\n<li class=\"botDescli\">„Äãset-automod</li>\n<li class=\"botDescli\">„Äãset-image-moderation</li>\n</ul>\n<h1>Configuration Commands</h1>\n<ul class=\"botDescul\">\n<li class=\"botDescli\">„Äãdisable-ai</li>\n<li class=\"botDescli\">„Äãdisable-global-chat</li>\n<li class=\"botDescli\">„Äãdisable-logs</li>\n<li class=\"botDescli\">„Äãenable-premium</li>\n<li class=\"botDescli\">„Äãset-global-chat</li>\n<li class=\"botDescli\">„Äãset-logs</li>\n</ul>\n<h1></h1>\n<ul class=\"botDescul\">\n<li class=\"botDescli\">Luibot is a reliable bot that can be used in any server with it\'s multipurpose functionality and easy to use bot.<br /><br />\nThe most interractive features are both the Artificial Intelengece feature &quot;AI&quot; and the Global Chat feature &quot;Global Chat&quot;.</li>\n<li class=\"botDescli\">Moderation | Fun  | Infomation | Stats  + More...</li>\n</ul>\n',1,1,1,1,1,0,0,1,2,'4',0,0,0,0,'uxOUjYvrYM9JE1-3oJzVKXE2M1VOAw9vyDe',NULL,NULL,'luibot',1),(65,'586875541479751680','Lyfe','https://cdn.discordapp.com/avatars/586875541479751680/5f1fedbe8cff49e22c47431518a4c052.png?size=512','null','174505110569877505','Tazio#0419','Wed Jan 06 2021 12:11:34 GMT+0100 (Central European Standard Time)','?',1,'Lyfe to make your life better','https://discord.com/oauth2/authorize?client_id=586875541479751680&scope=bot&permissions=8','https://discord.gg/sPWZ9nW','https://lyfe.tk','null','null','discord.js','<p class=\"botDescP\">Hi, my name is Tazio and today I‚Äôm going to introduce you to ** Lyfe **, it‚Äôs an ** all in 1 ** Discord bot that‚Äôs made to make your life more easier.<br /><br />\nIt has a lot of features and I‚Äôm working on it all the time.<br /><br />\nIt has moderation to ban/kick/mute people. It has a stylish design and very easy to use.<br /><br />\nI recommend you visiting the <a href=\"https://lyfe.gitbook.io/lyfe/\">Documentary</a> to find more information about the bot.<br /><br />\nTo make this easier for everyone I listen the main commands.<br />\nCategories:</p>\n<ol class=\"botDescol\">\n<li class=\"botDescli\">General</li>\n<li class=\"botDescli\">Fun</li>\n<li class=\"botDescli\">Moderation</li>\n<li class=\"botDescli\">Gambling</li>\n<li class=\"botDescli\">Education</li>\n<li class=\"botDescli\">Music</li>\n<li class=\"botDescli\">Bounty</li>\n<li class=\"botDescli\">Economics</li>\n</ol>\n<p class=\"botDescP\">Commands:</p>\n<ol class=\"botDescol\">\n<li class=\"botDescli\">help</li>\n<li class=\"botDescli\">config</li>\n<li class=\"botDescli\">kick</li>\n<li class=\"botDescli\">ban</li>\n<li class=\"botDescli\">warn</li>\n<li class=\"botDescli\">mute</li>\n<li class=\"botDescli\">play</li>\n<li class=\"botDescli\">blackjack</li>\n<li class=\"botDescli\">master</li>\n</ol>\n<p class=\"botDescP\">To get more information about a command type <code>?help [command]</code>. To configure Lyfe for your server you will need to type <code>?config</code>.<br /><br />\nYou can change the prefix, welcome message/role. Lyfe uses 3 rank‚Äôs.<br /><br />\nfor more information about what they can do <a href=\"https://lyfe.gitbook.io/lyfe/permission-levels\">click here</a>.<br /><br />\nIf you need more help click the Support Server.<br />\nHave a good one,<br /><br />\nTazio</p>\n',1,1,1,1,1,0,1,0,2,'5',0,1,1,0,'Uq2rrSfXqlro3YSBfVx8ixTjcziyP6PQRDz',NULL,NULL,'lyfe',0),(66,'466381571335913484','MythBot Radio','https://cdn.discordapp.com/avatars/466381571335913484/002481daf4c23b279696370811bfd08d.png?size=512','null','116730818822537225','JoKeR#6975','Tue Jan 12 2021 05:28:05 GMT+0100 (Central European Standard Time)','m! (Customizable)',1,'üíéMythBot Radio‚Ñ¢, one of the few unique music bots. Fully user-supported, with over 30+ Radio Stations from all over','https://discord.com/oauth2/authorize?client_id=466381571335913484&scope=bot&permissions=8','https://discord.gg/QcxbCSX','https://www.mythbot.org','null','https://paypal.me/VisionG?locale.x=en_GB','discord.js','<center>\r\n    <p><span style=\"color: #99AAB5;\">General Commands:</span></p>\r\n    </center>\r\n    <table style=\"width: 94.8862%; border-style: solid; border-color: #5865F2; margin-left: auto; margin-right: auto;\" border=\"3\" cellpadding=\"10\">\r\n    <tbody>\r\n    <tr style=\"height: 23px;\">\r\n    <td style=\"width: 163.533px; height: 23px;\"> <span style=\"color: black;\">Command</span></td>\r\n    <td style=\"width: 351.467px; height: 23px;\"> <span style=\"color: black;\">Usage</span></td>\r\n    <td style=\"width: 82px; height: 23px;\"> <span style=\"color: black;\">Aliases</span></td>\r\n    <td style=\"width: 237px; height: 23px;\"> <span style=\"color: black;\">Example</span></td>\r\n    </tr>\r\n    <tr style=\"height: 20px;\">\r\n    <td style=\"width: 163.533px; height: 20px;\"> <span style=\"color: #99AAB5;\">m!Invite</span></td>\r\n    <td style=\"width: 351.467px; height: 20px;\"> Invite Mythbot Radio</td>\r\n    <td style=\"width: 82px; height: 20px;\"> <span style=\"color: #d35400;\">#</span></td>\r\n    <td style=\"width: 237px; height: 20px;\"> <span style=\"color: #99AAB5;\">m!invite</span></td>\r\n    </tr>\r\n    <tr style=\"height: 20px;\">\r\n    <td style=\"width: 163.533px; height: 20px;\"> <span style=\"color: #99AAB5;\">m!Stations</span></td>\r\n    <td style=\"width: 351.467px; height: 20px;\"> Shows current available Radio Stations</td>\r\n    <td style=\"width: 82px; height: 20px;\"> <span style=\"color: #d35400;\">#</span></td>\r\n    <td style=\"width: 237px; height: 20px;\"> <span style=\"color: #99AAB5;\">m!statons</span></td>\r\n    </tr>\r\n    <tr style=\"height: 20px;\">\r\n    <td style=\"width: 163.533px; height: 20px;\"> <span style=\"color: #99AAB5;\">m!Troll</span></td>\r\n    <td style=\"width: 351.467px; height: 20px;\"> Plays random sounds in voice channel</td>\r\n    <td style=\"width: 82px; height: 20px;\"> <span style=\"color: #d35400;\">#</span></td>\r\n    <td style=\"width: 237px; height: 20px;\"> <span style=\"color: #99AAB5;\">m!troll</span></td>\r\n    </tr>\r\n    <tr style=\"height: 20px;\">\r\n    <td style=\"width: 163.533px; height: 20px;\"> <span style=\"color: #99AAB5;\">m!Donate</span></td>\r\n    <td style=\"width: 351.467px; height: 20px;\"> Show your support to Mythbot Radio</td>\r\n    <td style=\"width: 82px; height: 20px;\"> <span style=\"color: #d35400;\">#</span></td>\r\n    <td style=\"width: 237px; height: 20px;\"> <span style=\"color: #99AAB5;\">m!donate</span></td>\r\n    </tr>\r\n    <tr style=\"height: 20px;\">\r\n    <td style=\"width: 163.533px; height: 20px;\"> <span style=\"color: #99AAB5;\">m!Shards</span></td>\r\n    <td style=\"width: 351.467px; height: 20px;\"> Shows you shard information within your server</td>\r\n    <td style=\"width: 82px; height: 20px;\"> <span style=\"color: #d35400;\">#</span></td>\r\n    <td style=\"width: 237px; height: 20px;\"> <span style=\"color: #99AAB5;\">m!shards</span></td>\r\n    </tr>\r\n    <tr style=\"height: 20px;\">\r\n    <td style=\"width: 163.533px; height: 20px;\"> <span style=\"color: #99AAB5;\">m!Stats</span></td>\r\n    <td style=\"width: 351.467px; height: 20px;\"> Shows you stats on Mythbot Radio</td>\r\n    <td style=\"width: 82px; height: 20px;\"> <span style=\"color: #d35400;\">#</span></td>\r\n    <td style=\"width: 237px; height: 20px;\"> <span style=\"color: #99AAB5;\">m!stats</span></td>\r\n    </tr>\r\n    </tbody>\r\n    </table>\r\n    <center>\r\n    <p><span style=\"color: #99AAB5;\">Music Commands:</span></p>\r\n    </center>\r\n    <table style=\"width: 94.8862%; border-style: solid; border-color: #5865F2; margin-left: auto; margin-right: auto;\" border=\"3\" cellpadding=\"10\">\r\n    <tbody>\r\n    <tr style=\"height: 23px;\">\r\n    <td style=\"width: 163.533px; height: 23px;\"> <span style=\"