`!stop`` can be used to stop your active game at any time.\r\n- ``!info`` provides some useful details about the bot and rules of the game.\r\n### Admin ``New!``\r\n- ``!prefix [character]`` can be used to change the prefix the bot responds to in the current server. \r\n\r\n## Credits\r\n- Polymars - Original Developer\r\n- Smirf123 - Maintainer/Hoster',1,1,0,0,0,0,1,1,263,'4',0,0,0,0,'hozW2eJdlnxOtM7m7NaQdmnDAbbdTOHaKCs',35813,'1638250957784','sokobot',0),(145,'847849944264998953','California Blacklisting','https://cdn.discordapp.com/avatars/847849944264998953/8b4a9593c4247673d2d22910c4d51677.png?size=512','null','688747673762922545','Jesse B. | BlueSky Organization#0645','Sun May 30 2021 20:36:27 GMT+0000 (Coordinated Universal Time)','c!',0,'Keeps Bad People away and your server safe','https://discord.com/api/oauth2/authorize?client_id=847849944264998953&permissions=0&scope=bot','https://discord.gg/3GDt5eFqcY','null','null','null','discord.js','California Blacklists focuses on keeping Scummy People and Unwanted people out of servers, the bot is a Ban Database. California Blacklisting its self is a Server that Blacklists Servers, Users and lets people know if they are a bad person. \r\n\r\nWhat the Bot Offers\r\n\r\nKeeps your server safe by banning bad people\r\n\r\nAlways online 24/7\r\n\r\nNever False Bans\r\n\r\nAlways shows Proof',0,0,0,0,1,1,0,0,1,'5',0,0,0,0,'RFLt-UOvOg9DlQnTJlfHWt3e3fyRx9uv36i',NULL,NULL,'California Blacklist',1),(148,'849302882867216423','Dislate','https://cdn.discordapp.com/avatars/849302882867216423/e5bd75f2c11adf1a918da5293eb48dd1.png?size=512','null','688747673762922545','Jesse B. | BlueSky Organization#0645','Tue Jun 01 2021 17:40:12 GMT+0000 (Coordinated Universal Time)','+',0,'Dislate is a Translation BOT with more Then Translation Features','https://discord.com/oauth2/authorize?client_id=849302882867216423&scope=bot%20applications.commands&permissions=2147483647','https://discord.gg/QVvuZVPSaE','null','null','null','discord.js','D