ot','https://cdn.discordapp.com/avatars/618817616542433283/12b3392af6df26c12e4cb2b2113bdf44.png?size=512','null','259649217255964672','Jack Glenn#0806','Sun Jun 13 2021 17:11:19 GMT+0000 (Coordinated Universal Time)','/',0,'Keep track of member birthdays in your server!','https://discord.com/oauth2/authorize?client_id=618817616542433283&permissions=268815424&scope=bot%20applications.commands','https://utilibots.co.uk/support','https://utilibots.co.uk','null','https://utilibots.co.uk/store','discord.js','## Admin Commands:\r\n\r\n* `/set-channel` - Set the birthday announcement channel.\r\n* `/remove-channel` - Remove the birthday announcement channel.\r\n* `/set-birthdayrole` - Set the birthday role.\r\n* `/remove-birthdayrole` - Remove the configured birthday role.\r\n* `/force-birthday` - Force set up a member\'s birthday on this server.\r\n* `/purge-birthday` - Purge a user\'s configured birthday on this server.\r\n* `/purge-birthdays` - Purge the birthdays of members who have left the server.\r\n* `/check-birthday` - Check the birthday of a user on the server.\r\n* `/toggle-ping` - Toggle the role/user ping on birthday announcements.\r\n* `/restrict-access` - Restrict a user or role members from setting up a birthday.\r\n* `/grant-access` - Grant a user or a role\'s members access to set up a birthday.\r\n* `/blacklist` - Blacklist a user or a role\'s members from the bot.\r\n* `/whitelist` - Whitelist a user or a role\'s members to use the bot.\r\n* `/force-announce` - Force announce a failed birthday announcement.\r\n\r\n## Premium Commands:\r\n\r\n* `/set-age` - Set your current age to be displayed on annoucements.\r\n* `/remove-age` - Remove your configured age on this server.\r\n* `/set-image` - Set the image that is displayed on birthday announcements.\r\n* `/remove-image` - Remove the configured birthday announcements image.\r\n* `/toggle-ages` - Toggle displaying ages in users\' birthday announcements.\r\n* `/set-message` - Set the messages used on birthday announcements.\r\n* `/remove-message` - Remove a message used on birthday announcements.\r\n* `/redeem-premium` - Redeem your premium subscription for this server.\r\n\r\n## User Commands:\r\n\r\n* `/set-birthday` - Set up your birthday on this server.\r\n* `/view-birthday` - View your configured birthday for this server.\r\n* `/preview-announcement` - Preview how your birthday announcement will look.\r\n* `/remove-birthday` - Remove your configured birthday on this server.\r\n* `/view-server` - View the server bot information.\r\n* `/view-birthdays` - View all of the configured birthdays on this server.\r\n\r\n## Miscellaneous Commands:\r\n\r\n* `/help` - View all bot commands.\r\n* `/ping` - View the latency of the bot and API.\r\n* `/info` - View bot information.\r\n* `/stats` - View the statistics of the bot.\r\n* `/invite` - A link to invite the bot.\r\n* `/privacy` - Privacy policy of the bot.\r\n* `/debug` - Debug the bots required permissions.\r\n* `/bug` - Report a bug.\r\n* `/suggest` - Suggest a feature for the bot.\r\n* `/vote` - Links to vote for the bot.\r\n* `/voted` - Check when you or others last voted.\r\n* `/votes` - View all of the bot voters.\r\n* `/rate` - Rate the bot on various bot lists.\r\n* `/reviews` - View user reviews from Void Bots.',0,0,0,0,0,0,0,0,1,'5',0,0,0,0,'noPHXsyLQDuGeAPBbcne7u5-uorlPonRCyv',NULL,NULL,'Birthday Bot',1),(154,'617706329229754379','To-do Bot','https://cdn.discordapp.com/avatars/617706329229754379/94c206a3f7ef952730031bfd6b0de754.png?size=512','null','259649217255964672','Jack Glenn#0806','Sun Jun 13 2021 17:12:52 GMT+0000 (Coordinated Universal Time)','td!',1,'Ever have too many tasks to do, but don\'t want more software open? If so, this is the bot for you!','https://discord.com/oauth2/authorize?client_id=617706329229754379&permissions=388160&scope=applications.commands%20bot','https://utilibots.co.uk/support','https://utilibots.co.uk','null','https://utilibots.co.uk/store','discord.js','## Admin Commands:\r\n\r\n* `add-staff` - Add a role to access server commands.\r\n* `remove-staff` - Remove a roles access to server commands.\r\n* `list-staff` - List all of the set staff roles.\r\n* `setprefix` - Set the guilds bot prefix.\r\n\r\n## Server List Commands:\r\n\r\n* `add-servertask` - Add a task to the server list.\r\n* `edit-servertask` - Edit a task on the server list.\r\n* `remove-servertask` - Remove a task from the server list.\r\n* `list-servertask` - List all of the tasks from the server list.\r\n* `assign-task` - Assign a task to a specific staff member.\r\n* `complete-assignment` - Set an assigned task as completed.\r\n* `list-assignments` - List all of your assigned tasks.\r\n\r\n## User List Commands:\r\n\r\n* `timezone` - Set your time zone for timestamps/reminders.\r\n* `add-list` - Add a list to your personal lists.\r\n* `edit-list` - Edit the name of a personal list\r\n* `remove-list` - Remove a personal list.\r\n* `add-task` - Add a task to one of your personal lists.\r\n* `edit-task` - Edit a task on a personal list.\r\n* `move-task` - Move a task from one personal list to another.\r\n* `remove-task` - Remove a task from a personal list.\r\n* `list` - List all of the tasks from a personal list.\r\n* `lists` - All of your personal lists.\r\n* `archive-task` - Archive a task from one of your personal lists.\r\n* `archives` - A list of all the archived personal tasks.\r\n* `remind` - Set a personal reminder.\r\n* `auto-remind` - Set a repetitive personal reminder.\r\n* `edit-reminder` - Edit the text of a personal reminder.\r\n* `remove-reminder` - Remove a personal reminder.\r\n* `remove-autoreminder` - Remove a personal auto reminder.\r\n* `reminders` - List all of your personal reminders.\r\n* `auto-reminders` - List all of your personal auto reminders.\r\n\r\n## Miscellaneous Commands:\r\n\r\n* `help` - View all bot commands.\r\n* `invite` - A link to invite the bot.\r\n* `info` - View bot information.\r\n* `vote` - Links to vote for the bot.\r\n* `ping` - View the latency of the bot and API.\r\n* `stats` - View the statistics of the bot.\r\n* `voted` - Check when you or others last voted.\r\n* `votes` - View all of the bot voters.\r\n* `rate` - Rate the bot on various bot lists.\r\n* `reviews` - Look at the bot\'s reviews from Void Bots.\r\n* `suggest` - Suggest a feature for the bot.\r\n* `privacy` - Privacy policy of the bot.\r\n* `debug` - Debug the bots required permissions.\r\n* `bug` - Report a bug or anything related to the bot.',0,0,0,0,0,0,0,0,1,'5',0,0,0,0,'jAYQllzqlDX-uuYTrZAirbppU3ztdrXnKs_',NULL,NULL,'To-do Bot',1),(155,'661522137550553088','GlennMail','https://cdn.discordapp.com/avatars/661522137550553088/137d21fd893fff5f3b5fb1830f139000.png?size=512','null','259649217255964672','Jack Glenn#0806','Sun Jun 13 2021 17:14:16 GMT+0000 (Coordinated Universal Time)','gm!',0,'Need help? Support is just a DM away!','https://discord.com/oauth2/authorize?client_id=881207265376481341&permissions=268823632&scope=bot','https://utilibots.co.uk/support','https://utilibots.co.uk','null','https://utilibots.co.uk/store','discord.js','_____\r\n\r\n# Server Member Interaction\r\n\r\n* **Creating a Ticket** - Creating a ticket is simple, you send any kind of direct message to GlennMail and he will respond with a list of all your mutual guilds. All you have to do is respond with the number that relates to the guild.\r\n\r\n* **Responding to a Ticket** - Once the ticket is created, anything you say after that point will be sent directly to that ticket channel for server staff to see. The bot will give hints after 2 minutes of idle time if you still wish to send the message or cancel the ticket.\r\n\r\n* **Ending a Ticket** - Once you\'ve felt you have everything you need from the ticket, simply respond with gm!end and the ticket will close on your end. Server staff will be notified of this action and can move to close the ticket altogether on their end.\r\n\r\n_____\r\n\r\n# Server Staff Interaction\r\n\r\n* **Responding to a Ticket** - To respond to an open ticket you need to use gm!r <Message> in the ticket channel to have that message sent to the ticket author. This way you can still discuss the contents of a ticket with other staff in the channel without them seeing everything unless the command is used.\r\n\r\n* **Closing a Ticket** - Closing a ticket is done using gm!close which will notify the ticket author of this action (Unless they ended it first) and the ticket along with a transcript will be logged in the specified channel.\r\n\r\n_____\r\n\r\n# Bot Commands\r\n\r\n*You can use gm!help <Command> to get a description of the command or a usage example.*\r\n\r\n### Staff Commands:\r\n* `gm!setup` - Set the bot up to work in the server.\r\n* `gm!reply <Message>` - Reply to the ticket author inside a ticket channel.\r\n* `gm!close` - Close a ticket channel.\r\n* `gm!blacklist <@User/UserID>` - This allows you to blacklist a user from creating tickets in your server.\r\n* `gm!blacklisted` - Displays all of the currently blacklisted server members.\r\n* `gm!whitelist <@User/UserID>` - Whitelist a user on the bot so they can create tickets again.\r\n* `gm!status` - View the current status on ticket creation in the server.\r\n* `gm!status <Enable/Disable>` - Change the status of ticket creations in the server. \r\n\r\n### User Commands:\r\n* `gm!end` - End your ticket (Only works in DMs)\r\n* `gm!transcripts` - A list of all your stored transcripts.\r\n\r\n### Miscellaneous Commands:\r\n* `gm!help` - A list of all the bot commands.\r\n* `gm!server` - Displays the current setup of the bot.\r\n* `gm!stats` - Shows the bots statistics. \r\n* `gm!diagnose` - Shows missing permissions or functions that aren\'t setup/don\'t work due to permissions.\r\n* `gm!ping` - Outputs the response time and uptime of the bot.\r\n* `gm!info` - Shows information specific to the bot (Developer, Staff etc)\r\n* `gm!invite` - An invite link to the bot.\r\n* `gm!prefix` - Bots prefix.\r\n* `gm!vote` - Links you to all of the bot lists where you can vote for the bot. \r\n* `gm!voted` - Returns the data on your last vote (If any)\r\n* `gm!voted <@User/UserID>` - Check when a user last voted for the bot.\r\n* `gm!votes` - Lists all of the current bot voters and their vote count.',0,0,0,0,0,0,0,0,1,'5',0,0,0,0,'EzoHE3HlHWZi3v75F4oewiu7d1_QRL8o8zO',NULL,NULL,'GlennMail',1),(156,'798997423715778600','UtiliBots Invites','https://cdn.discordapp.com/avatars/798997423715778600/2f4be67588fcbda784b7b9ae2ec81c02.png?size=512','null','259649217255964672','Jack Glenn#0806','Sun Jun 13 2021 17:16:39 GMT+0000 (Coordinated Universal Time)','ub?',0,'Keep track of server invites all from one bot!','https://discord.com/api/oauth2/authorize?client_id=798997423715778600&permissions=388193&scope=bot','https://utilibots.co.uk/support','https://utilibots.co.uk','null','https://utilibots.co.uk/store','discord.js','# Bot Features:\r\n* Users can keep track of every server invite they have created alongside the specific analytics of each.\r\n* If invite creators rejoin via their own invite then they will be given a fake join which so server administrators can see which users are trying to cheat/abuse the system.\r\n* You have the option between choosing whether log messages are done via embeds or normal Discord messages.\r\n* The bot hardly goes offline, if it does, it is most likely due to planned maintenance. Join our Support Server to request help.\r\n\r\n# Support:\r\nThis bot is associated with UtiliBots, if you require any support or wish to forward feedback or suggestions then you can do so by visiting the UtiliBots discord server [here](https://invite.utilibots.co.uk).\r\n\r\n# Commands:\r\n\r\n#### Admin Commands:\r\n* `setlog` - Set the join/leave logs channel.\r\n* `variables` - View a list of variables for join/leave messages.\r\n* `setmessage` - Set the join/leave message.\r\n* `togglemessage` - Toggle whether logs are sent as a plain.\r\n* `preview` - View how the logging outputs when emitted.\r\n\r\n#### User Commands:\r\n* `invites` - Information on your/other members server invites.\r\n\r\n#### Miscellaneous Commands:\r\n* `help` - View all bot commands.\r\n* `info` - View bot information.\r\n* `invite` - A link to invite the bot.\r\n* `ping` - View the latency of the bot and API.\r\n* `server` - View the current server setup.\r\n* `stats` - View the statistics of the bot.\r\n* `debug` - Debug the bots permissions/functions.\r\n* `bug` - Report a bug to the Developer.\r\n* `allinvites` - Information on all of the server invites.\r\n* `rate` - Rate the bot on various bot lists.\r\n* `reviews` - Look at the bot\'s reviews from Void Bots.\r\n* `suggest` - Suggest a feature for the bot.\r\n* `vote` - Links to vote for the bot.\r\n* `voted` - Check when you and others last voted.\r\n* `votes` - View the top 10 bot voters.',0,0,0,0,0,0,0,0,1,'5',0,0,0,0,'4MDGioaPcHXkph47baQrGCQ7oVdNORzUbpE',NULL,NULL,'UtiliBots Invites',1),(157,'663515546557480990','TicketAid','https://cdn.discordapp.com/avatars/663515546557480990/167077d8f94727f5b9b74110b557c4a7.png?size=512','null','259649217255964672','Jack Glenn#0806','Sun Jun 13 2021 17:18:42 GMT+0000 (Coordinated Universal Time)','>',1,'A Discord bot to keep your support system professional and efficient.','https://discord.com/api/oauth2/authorize?client_id=663515546557480990&permissions=268823632&scope=applications.commands%20bot','https://utilibots.co.uk/support','https://utilibots.co.uk','null','https://utilibots.co.uk/store','discord.js','## Bot Features\r\n* Tickets are tracked and stored via transcripts which are sent into the specified ticket logs channel and direct messaged to the ticket author at the end.\r\n* TicketAid allows staff to manage tickets in a variety of ways such as adding/removing other users that might be needed in certain tickets.\r\n* The bot hardly goes offline, if it does, it is most likely due to planned maintenance.Join our Support Server to request help.\r\n* TicketAid comes with all the necessary checks to make sure that only the users with the assigned staff role are able to use the restricted staff commands.\r\n\r\n## Support\r\nTickedAid is associated with UtiliBots, if you require any support or wish to forward feedback or suggestions then you can do so by visiting the discord server [here](https://invite.utilibots.co.uk).\r\n\r\n## Commands\r\n#### Admin Commands:\r\n* `setup` - Setup the ticket system.\r\n* `toggletickets` - Toggle the creation of new tickets.\r\n* `add-staff` - Add a role to access staff commands.\r\n* `remove-staff` - Removes role access from staff commands.\r\n* `list-staff` - List all of the designated staff roles.\r\n* `setprefix` - Set the guilds bot prefix.\r\n* `blacklist` - Blacklist a user from creating tickets.\r\n* `whitelist` - Whitelist a user to create tickets.\r\n* `blacklisted` - List all of the users blacklisted from creating tickets.\r\n\r\n#### Staff Commands:\r\n* `claim` - Claim a ticket.\r\n* `add` - Add a user to a ticket.\r\n* `del` - Remove a user from a ticket.\r\n* `close` - Close a ticket.\r\n\r\n#### User Commands:\r\n\r\n* `new` - Create a new ticket.\r\n* `transcripts` - A list of all your transcripts.\r\n\r\n#### Miscellaneous Commands:\r\n\r\n* `help` - View all bot commands.\r\n* `config` - View the server configuration.\r\n* `stats` - View the statistics of the bot.\r\n* `info` - View bot information.\r\n* `debug` - Debug the bots required permissions.\r\n* `bug` - Report a bug.\r\n* `ping` - View the latency of the bot and API.\r\n* `invite` - A link to invite the bot.\r\n* `privacy` - Privacy policy of the bot.\r\n* `suggest` - Suggest a feature for the bot.\r\n* `rate` - Rate the bot on various bot lists.\r\n* `reviews` - Look at the bot\'s reviews from Void Bots.\r\n* `vote` - Links to vote for the bot.\r\n* `voted` - Check when you or others last voted.\r\n* `votes` - View all of the bot voters.',0,0,0,0,0,0,0,0,1,'5',0,0,0,0,'VC6ymSRwUldAUme1ToH4Iu3xWcv9okNnqB_',NULL,